import React, { useState } from "react";
const MarktingPlugin = () => {
  const [showBase, setShowSearch] = useState(true);
  return (
    <div>
      {showBase && (
        <>
          <div>用户画像</div>
          <div>库存管理</div>
          <div>日程管理</div>
        </>
      )}
    </div>
  );
};
export default MarktingPlugin;
